description:
Read with us a tale of two resurrections in REVELATION 20. The first resurrection is unto life eternal through Jesus Christ. The second resurrection is unto eternal death. Herein we learn about the Great White Throne after the finality of Satan. Throughout our study, gain perspective on the millennial kingdom, and know the present choice you have of salvation through Jesus.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
